  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset shows U.S. Census Tract (2010)
  boundaries containing tabular data related to tree planting priorities. Prioritization
  is based on 31 GIS datasets summarized into eight broad categories: public health
  & safety, air quality, environmental justice, water quality, critical places, forest
  replenishment, forest preservation & development impacts, and urban heat island.rnrnThe
  City of Austinu2019s Tree Planting Prioritization serves as a decision support tool
  for locating tree planting sites for Austinu2019s October through March tree planting
  season.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
